      <div className="gif-section">
        <img src={require("../assest/lightBanner.gif")} alt="Description of the image" />
        <div className="details">
          <div className="top-detail">
            <p> BECOME AN</p>
            <h1>
              INSEDER <SvgWrapper src="Vector" />
            </h1>
            <h3>
              Get the latest updates on our new collections and offers at one
              click
            </h3>
          </div>
          <button>ENTER EMAIL</button>
        </div>
      </div>
    </div>
  );
};

export default LightBanner;
